        "approved_at": 1563245832,
        "instructions": [
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 48887,
            "position": 1,
            "display_text": "Line a baking sheet with parchment paper."
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 48888,
            "position": 2,
            "display_text": "Divide the sugar evenly between 6 small bowls, 2 tablespoons per bowl."
          },
          {
            "display_text": "Dye each bowl of sugar a different color by adding 1-2 drops of red, orange, yellow, green, blue and purple food coloring. Stir each bowl with a clean fork until the sugars are sandy in texture. Note: We recommend gel food coloring, as the colors are more stable. Only use 1-2 drops; a little goes a long way.",
            "start_time": 8333,
            "appliance": null,
            "end_time": 29666,
            "temperature": null,
            "id": 48889,
            "position": 3
          },
          {
            "temperature": null,
            "id": 48890,
            "position": 4,
            "display_text": "Add 1 teaspoon of coconut oil and 2 popcorn kernels to a medium nonstick saucepan with a lid. Cover and place over medium-high heat. Once the kernels pop, reduce the heat to medium and add 2 tablespoons of popcorn kernels and 1 bowl of colored sugar. Immediately cover the pan and shake to combine. Cook, shaking the pan constantly to ensure that the sugar doesn’t burn, while the popcorn pops.  Once the pops are more than 3 seconds apart, remove the pot from heat. Carefully remove the lid away from your body and pour the popcorn onto the prepared baking sheet.",
            "start_time": 31000,
            "appliance": null,
            "end_time": 58166
          },
          {
            "temperature": null,
            "id": 48891,
            "position": 5,
            "display_text": "Evenly sprinkle ¼ teaspoon salt over the hot kettle corn. Let the popcorn cool completely, transfer to a bowl. Repeat with the remaining colors, replacing the parchment paper as needed.",
            "start_time": 59000,
            "appliance": null,
            "end_time": 66833
          },
          {
            "display_text": "Combine all of the popcorn in a large bowl. Toss to distribute the colors evenly. Serve immediately, or store in an airtight container for up to 2 days.",
            "start_time": 68000,
            "appliance": null,
            "end_time": 104500,
            "temperature": null,
            "id": 48892,
            "position": 6
          },
          {
            "temperature": null,
            "id": 48893,
            "position": 7,
            "display_text": "Enjoy!",
            "start_time": 105666,
            "appliance": null,
            "end_time": 124533
          }
        ],
