        "instructions": [
          {
            "temperature": 200,
            "id": 35740,
            "position": 1,
            "display_text": "Preheat the oven to 200°F (95°C). Line 2 baking sheets with parchment paper.",
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0
          },
          {
            "id": 35741,
            "position": 2,
            "display_text": "Add the sugar to a baking sheet and bake for 7 minutes. The edges may begin to caramelize – this is good! Remove the sugar from the oven and leave the oven on.",
            "start_time": 3833,
            "appliance": null,
            "end_time": 6316,
            "temperature": null
          },
          {
            "appliance": null,
            "end_time": 22299,
            "temperature": null,
            "id": 35742,
            "position": 3,
            "display_text": "In a large clean, dry bowl, whip the egg whites with an electric hand mixer on low speed until foamy, then add the salt. Continue whipping on high speed until medium peaks form.",
            "start_time": 8650
          },
          {
            "temperature": null,
            "id": 35743,
            "position": 4,
            "display_text": "Add the toasted sugar to the egg whites 1 tablespoon at a time, increasing the mixer speed gradually as you add more sugar. Once all of the sugar is incorporated, continue whipping for 5-7 minutes, until the meringue is very thick and shiny.",
            "start_time": 22633,
            "appliance": null,
            "end_time": 37783
          },
          {
            "appliance": null,
            "end_time": 44100,
            "temperature": null,
            "id": 35744,
            "position": 5,
            "display_text": "Add in vanilla, just whipping until incorporated.",
            "start_time": 37949
          },
          {
            "start_time": 45099,
            "appliance": null,
            "end_time": 57916,
            "temperature": null,
            "id": 35745,
            "position": 6,
            "display_text": "Prop open a piping bag or zip-top bag in a tall drinking glass. Using wooden skewers, lightly paint 2 thin stripes of different-colored gel food coloring on opposite sides of the bag. Paint additional bags with more colors, if desired."
          },
          {
            "temperature": null,
            "id": 35746,
            "position": 7,
            "display_text": "Fill each bag with the meringue batter, dividing evenly amongst different colors, if using.",
            "start_time": 58083,
            "appliance": null,
            "end_time": 66400
          },
          {
            "start_time": 67566,
            "appliance": null,
            "end_time": 77711,
            "temperature": null,
            "id": 35747,
            "position": 8,
            "display_text": "Pipe 1-inch (2-cm) wide “kisses” of meringue onto a baking sheet about ½ inch (1 cm) apart."
          },
          {
            "end_time": 0,
            "temperature": null,
            "id": 35748,
            "position": 9,
            "display_text": "Bake for about 1 hour, or until you can easily lift a kiss off of the paper.",
            "start_time": 0,
            "appliance": null
          },
          {
            "end_time": 80383,
            "temperature": null,
            "id": 35749,
            "position": 10,
            "display_text": "Cool the meringues on the baking sheet at room temperature until no longer warm.",
            "start_time": 80050,
            "appliance": null
          },
          {
            "id": 35750,
            "position": 11,
            "display_text": "To fill, pipe buttercream icing around the edge of a cookie and place a small dollop of jam in the center. Sandwich with another cookie.",
            "start_time": 80716,
            "appliance": null,
            "end_time": 91695,
            "temperature": null
          },
          {
            "end_time": 96333,
            "temperature": null,
            "id": 35751,
            "position": 12,
            "display_text": "Enjoy!",
            "start_time": 92199,
            "appliance": null
          }
        ],
