        "instructions": [
          {
            "position": 1,
            "display_text": "Using a hand mixer or standing mixer, beat butter until creamy.",
            "start_time": 3310,
            "appliance": null,
            "end_time": 5800,
            "temperature": null,
            "id": 17285
          },
          {
            "start_time": 6480,
            "appliance": null,
            "end_time": 16100,
            "temperature": null,
            "id": 17286,
            "position": 2,
            "display_text": "Add powdered sugar and beat until combined. Add the eggs, vanilla, and salt. Beat until well combined."
          },
          {
            "appliance": null,
            "end_time": 24420,
            "temperature": null,
            "id": 17287,
            "position": 3,
            "display_text": "Gradually, add the flour until dough is moist and holds together, but doesn’t stick to your hands.",
            "start_time": 16800
          },
          {
            "temperature": null,
            "id": 17288,
            "position": 4,
            "display_text": "Place dough on a cutting board and form into a ball. Cut in half, then cover one half with plastic wrap and set aside.",
            "start_time": 25270,
            "appliance": null,
            "end_time": 30570
          },
          {
            "start_time": 30970,
            "appliance": null,
            "end_time": 33950,
            "temperature": null,
            "id": 18083,
            "position": 5,
            "display_text": "Divide the other half into 6 pieces. The outer layers of the rainbow will need a little bit more dough, so make two of them slightly larger than the others."
          },
          {
            "display_text": "Dye the dough with food coloring by placing a ¼ teaspoon of dye on the ball of dough and kneading it until it is one solid color. Gloves optional but suggested.",
            "start_time": 34340,
            "appliance": null,
            "end_time": 44050,
            "temperature": null,
            "id": 17289,
            "position": 6
          },
          {
            "id": 17290,
            "position": 7,
            "display_text": "Starting with purple, roll the dough into a log about 6-8 inches (15-20 cm) long. This will be the center of the rainbow.",
            "start_time": 44290,
            "appliance": null,
            "end_time": 46600,
            "temperature": null
          },
          {
            "display_text": "Next, roll out the blue dough with a rolling pin until it’s about ¼ inch (6 mm) thick, slightly longer than the purple, and wide enough to wrap around the purple dough. Repeat with the green, yellow, orange, and red doughs. The further away from the purple you get, the wider the dough needs to be to go around the previous color, making the red dough the widest.",
            "start_time": 47730,
            "appliance": null,
            "end_time": 53650,
            "temperature": null,
            "id": 18084,
            "position": 8
          },
          {
            "position": 9,
            "display_text": "Wrap the blue dough around the purple, pinching together any cracks that form, cutting off any excess dough. Repeat with the rest of the colors.",
            "start_time": 54949,
            "appliance": null,
            "end_time": 63020,
            "temperature": null,
            "id": 17291
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 18085,
            "position": 10,
            "display_text": "Wrap in plastic wrap and chill for 30 minutes."
          },
          {
            "id": 17292,
            "position": 11,
            "display_text": "Once chilled, remove the plastic wrap, and cut the dough in half to make 2 rainbow shapes. Set aside.",
            "start_time": 65349,
            "appliance": null,
            "end_time": 69650,
            "temperature": null
          },
          {
            "position": 12,
            "display_text": "Cut the reserved dough in half, roll out to ¼-inch (6 mm) thickness, and make it slightly longer than the rainbow log.",
            "start_time": 70350,
            "appliance": null,
            "end_time": 75380,
            "temperature": null,
            "id": 17293
          },
          {
            "temperature": null,
            "id": 18086,
            "position": 13,
            "display_text": "Place the rainbow dough in the center and wrap the plain dough around it, again, pinching together any cracks and smoothing out the surface.",
            "start_time": 76020,
            "appliance": null,
            "end_time": 80169
          },
          {
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 18087,
            "position": 14,
            "display_text": "Repeat with the other halves. Wrap with plastic wrap and chill for another 30 minutes.",
            "start_time": 0
          },
          {
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350,
            "id": 17284,
            "position": 15,
            "display_text": "Preheat oven to 350˚F (180˚C).",
            "start_time": 0
          },
          {
            "position": 16,
            "display_text": "Once chilled, remove the plastic wrap. Slice cookies about ½-inch (1 cm) thick and place on a parchment paper-lined baking sheet.",
            "start_time": 83500,
            "appliance": null,
            "end_time": 91800,
            "temperature": null,
            "id": 17294
          },
          {
            "temperature": null,
            "id": 17295,
            "position": 17,
            "display_text": "Bake for 20 minutes or until the bottom has browned slightly.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 17296,
            "position": 18,
            "display_text": "Cool on a cooling rack."
          },
          {
            "end_time": 102100,
            "temperature": null,
            "id": 17297,
            "position": 19,
            "display_text": "Enjoy!",
            "start_time": 94740,
            "appliance": null
          }
        ],
