            "description": "There's no better season to celebrate love than summer and undoubtedly, the best way is with your favorite Pride-forward foods! Whip out those aprons and test out the coolest Pride menu recipes in town! Can you imagine ice cream sandwiches getting any better? Well, get ready for our colorful <a href=\"https://tasty.co/recipe/rainbow-ice-cream-sandwich\">Rainbow Ice Cream Sandwich</a>! To balance it all out, pair it with the <a href=\"https://tasty.co/recipe/rainbow-sheet-pan-pizza\">Rainbow Sheet Pan Pizza</a> for a perfect patio meal. It's time to celebrate love for all! ",
