            "description": "You can never have enough chocolates, can you?  Whether it's an ice cream, donut, cake or waffle, chocolate dominates them all and boy does it hit it out of the park! For your midnight cravings, try the quick and easy <a href=\"tasty.co/recipe/chocolate-hazelnut-mug-cakes\">Chocolate Hazelnut Mug Cake</a>. Have a date night? Impress them with the elegant <a href=\"tasty.co/recipe/chocolate-mousse\">Chocolate Mousse</a>. Want some comfort food? Bake yourselves a fresh batch of <a href=\"tasty.co/recipe/chocolate-chip-cookies\">Chocolate Chip Cookie</a>. When it comes to chocolate, more is more!",
