            "id": 2453,
            "description": "Summer is here and for us, that means loads and loads of ice cream. Of course, eating out of the pint can get old, so we've got ways to keep you cool and curious with our creamy confections. Whip yourself up a <a href=\"https://tasty.co/recipe/pineapple-ice-cream-float\">pineapple ice cream float</a> or dig into some decadent <a href=\"https://tasty.co/recipe/brownie-ice-cream-bombs\">brownie ice cream bombs</a> this summer! Or, celebrate taco Tuesday with our <a href=\"https://tasty.co/recipe/chocolate-dipped-ice-cream-tacos\">chocolate-dipped ice cream tacos</a>. I scream, you scream, we all scream for ice cream! ",
