            "description": "Looking for some ice cream that matches your mood and your tastebuds? Well now, you can just have the stars pick a pint just for you. From our <a href=\"https://tasty.co/recipe/brownie-ice-cream-bombs\">ice cream bomb</a> for the fierce Leo to the <a href=\"https://tasty.co/recipe/ice-cream-sandwich-cake\">giant ice cream sandwich cake</a> for the dynamic Aries, we've got all your zodiac-curated flavors lined right here! Hurry and find out what your signs have in store for you.",
