            "description": "It's ice cream season: our favorite season! And while we love to dig into a classic scoop, we're also always down for fun new ways to indulge our sweet tooth. Whether it's with a beautiful Neapolitan <a href=\"https://tasty.co/recipe/neapolitan-ice-cream-cake-roll\">ice cream roll</a>, topped with a glistening chocolate sauce, or the adventurous, <a href=\"https://tasty.co/recipe/giant-mochi-ice-cream\">giant mochi ice cream</a> that's fit for a crowd, we've got ice cream innovations for days! Oh, and you haven't truly indulged until you try our <a href=\"https://tasty.co/recipe/ice-cream-sandwich-swirl-cake\">ice cream swirl sandwiches</a> that pair the best of both worlds! So what're you waiting for? We scream, you scream, everyone screams for ice cream! ",
