            "description": "Feeding the kids on a busy weeknight doesn't have to be a daunting task. Kick off the week with some <a href=\"https://tasty.co/recipe/cheese-stuffed-sliders\">Cheese-stuffed Sliders</a>, or satisfy their sweet tooth with <a href=\"https://tasty.co/recipe/smores-cones\">S'mores Cones</a>. Put a twist on a plain ol' bowl of tomato soup with a <a href=\"https://tasty.co/recipe/the-ultimate-grilled-cheese-and-tomato-soup-bowl\">Grilled Cheese Bowl</a> or bring some imagination to dinner time with a <a href=\"https://tasty.co/recipe/sleeping-rice-bear-egg-blanket\n\">Sleepy Rice Bear</a>. You can make weeknights delicious with these recipes we've curated, just for you.",
