        "buzz_id": null,
        "description": "This twist on zucchini bread combines the best of both worlds: cinnamon and spice with decadent triple chocolate. Don’t worry about squeezing excess liquid from the zucchini — it will keep the bread moist! Before you bake, swirl the two batters together with a skewer or knife for a perfect marbling effect. For the best slice, let the bread cool completely before serving — but you might not be able to wait that long!",
        "is_one_top": false,
        "canonical_id": "recipe:5504",
        "created_at": 1565813078,
        "cook_time_minutes": 90,
        "instructions": [
          {
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350,
            "id": 49587,
            "position": 1,
            "display_text": "Preheat the oven to 350˚F (180˚C)."
          },
          {
            "start_time": 5000,
            "appliance": null,
            "end_time": 18666,
            "temperature": null,
            "id": 49588,
            "position": 2,
            "display_text": "Trim the ends of the zucchini, then grate on the large holes of a box grater. You should have about 3 cups (450 G) total."
          },
          {
            "start_time": 20000,
            "appliance": null,
            "end_time": 52833,
            "temperature": null,
            "id": 49589,
            "position": 3,
            "display_text": "In a large bowl, whisk together the brown and granulated sugars, eggs, canola oil, apple cider vinegar, and vanilla. Fold in the shredded zucchini."
          },
          {
            "end_time": 59333,
            "temperature": null,
            "id": 49590,
            "position": 4,
            "display_text": "Pour half of the wet ingredients, about 2 cups, into a medium bowl.",
            "start_time": 54000,
            "appliance": null
          },
          {
            "start_time": 54000,
            "appliance": null,
            "end_time": 87000,
            "temperature": null,
            "id": 49591,
            "position": 5,
            "display_text": "In a medium bowl, whisk together 1 cup (125 G)flour, the cocoa powder, 1 teaspoon baking soda, and ½ teaspoon salt. Add the cocoa mixture the bowl with half of the zucchini mixture and mix well. Fold in the chocolate chips. Set aside."
          },
          {
            "position": 6,
            "display_text": "In a separate medium bowl, whisk together the remaining 1½ cups (185 G) flour, 1 teaspoon baking soda, ½ teaspoon salt, and the cinnamon.",
            "start_time": 89000,
            "appliance": null,
            "end_time": 96166,
            "temperature": null,
            "id": 49592
          },
          {
            "position": 7,
            "display_text": "Fold the dry ingredients into the remaining bowl of wet ingredients.",
            "start_time": 97000,
            "appliance": null,
            "end_time": 113666,
            "temperature": null,
            "id": 49593
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 49594,
            "position": 8,
            "display_text": "Grease a 9x5-inch (6 x 12 cm) loaf pan with nonstick spray."
          },
          {
            "temperature": null,
            "id": 49595,
            "position": 9,
            "display_text": "Using 2 ¼-cup measures, alternate scooping the batters to the prepared pan to create a marbled effect.",
            "start_time": 122000,
            "appliance": null,
            "end_time": 139666
          },
          {
            "temperature": null,
            "id": 49596,
            "position": 10,
            "display_text": "Bake until a cake tester inserted in the center of the cake comes out clean, 70–80 minutes.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "display_text": "Let the bread cool for 15 minutes in the pan, then transfer to a wire rack to cool completely, about 30 minutes. Slice and serve.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 49597,
            "position": 11
          },
          {
            "start_time": 156000,
            "appliance": null,
            "end_time": 160500,
            "temperature": null,
            "id": 49598,
            "position": 12,
            "display_text": "Enjoy!"
          }
        ],
