        "instructions": [
          {
            "appliance": null,
            "end_time": 13049,
            "temperature": null,
            "id": 2170,
            "position": 1,
            "display_text": "Prepare Chocolate and White Cake Mixes according to directions on the box.",
            "start_time": 0
          },
          {
            "position": 2,
            "display_text": "NOTE: It is recommended that you use the same brand of cake mix for each, and ensure they share a similar bake time.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 10307
          },
          {
            "end_time": 22767,
            "temperature": null,
            "id": 9442,
            "position": 3,
            "display_text": "Divide prepared White Cake Batter into 4 separate bowls. Use food coloring to create vivid Red, Yellow, Green, and Blue Batter.",
            "start_time": 14650,
            "appliance": null
          },
          {
            "appliance": null,
            "end_time": 29817,
            "temperature": null,
            "id": 2171,
            "position": 4,
            "display_text": "In a greased bundt pan, spoon about ⅓ of the prepared Chocolate Cake Mix onto the bottom. Using a tablespoon, carefully spoon a thin ring of Red Cake Batter on top of the chocolate layer - being careful to keep it centered and ensure it does not spread to the edge of the pan.",
            "start_time": 24817
          },
          {
            "start_time": 30067,
            "appliance": null,
            "end_time": 38067,
            "temperature": null,
            "id": 9444,
            "position": 5,
            "display_text": "Repeat with Yellow, Green, and Blue Batter, carefully spooning each on top of the previous. Finish by carefully covering the colored layers with an additional ⅓ of the Chocolate Cake Mix (leaving about ⅓ extra so as not to overfill the pan)."
          },
          {
            "end_time": 0,
            "temperature": 350,
            "id": 2172,
            "position": 6,
            "display_text": "Bake in a preheated oven for 35 minutes at 350°F (175°C). Remove from oven and allow cake to cool.",
            "start_time": 0,
            "appliance": "oven"
          },
          {
            "start_time": 43417,
            "appliance": null,
            "end_time": 50250,
            "temperature": null,
            "id": 2173,
            "position": 7,
            "display_text": "Turn out onto a plate and decorate."
          },
          {
            "appliance": null,
            "end_time": 60417,
            "temperature": null,
            "id": 9443,
            "position": 8,
            "display_text": "Enjoy!",
            "start_time": 50567
          }
        ],
