            "description": "You should celebrate you, and we have a cake for every day of the week to help you do that. Start off with a slice of our pretty <a href=\"https://tasty.co/recipe/chocolate-ripple-cheesecake\">Chocolate Ripple Cheesecake</a>, then devour <a href=\"https://tasty.co/recipe/earl-grey-blackberry-cake\">Earl Grey blackberry cake</a> the very next day! You can even treat yourself to our <a href=\"https://tasty.co/recipe/rice-cooker-upside-down-pineapple-cake\">upside down pineapple cake</a> for breakfast if you'd like! You deserve the simple, delicious joys of life every day of the week. So what are you waiting for? Throw on your apron, let's get baking! ",
