        "description": "We’ve all been baking <a href=\"https://tasty.co/recipe/banana-bread\">banana bread</a> lately, right? It’s been good, but it’s gotten, well, just a tad routine. In fact, it’s probably making you go just a liiiittle bananas yourself! So it’s time to sweeten the deal: this chocolate chip banana bread recipe combines two of your favorite things into one – now, you can have your chocolate and eat it, too! (Or try a healthier spin on this classic treat with our delicious <a href=\"https://tasty.co/recipe/healthy-blueberry-banana-bread\">blueberry banana bread recipe</a>.)\n",
