            "description": "Let's face it, no one likes doing the dishes. It's annoying and tedious, but hey, that's no reason to tuck in to another night of Top Ramen. That's where we come in, and so do those long-forgotten coffee mugs. For your sugar cravings, indulge in our <a href=\"https://tasty.co/recipe/blueberry-french-toast-in-a-mug\">blueberry French toast</a> in a mug. Rushing to work? The <a href=\"https://tasty.co/recipe/microwave-3-minute-omelette-in-a-mug\">3-minute microwave mug omelet breakfast</a> is there for you. And for a late-night pasta delight, tuck into our <a href=\"https://tasty.co/recipe/mug-baked-rigatoni\">mug-baked rigatoni</a>. No one will believe that it came out of the microwave, not even you! ",
