    "thumbnail_url": "https://img.buzzfeed.com/tasty-app-user-assets-prod-us-east-1/recipes/93870a2b57994ae5a8fde13e88042076.jpeg",
    "servings_noun_plural": "Servings",
    "instructions": [
      {
        "temperature": null,
        "id": 71745,
        "position": 1,
        "display_text": "Line a 9-inch square glass baking dish with plastic wrap.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71746,
        "position": 2,
        "display_text": "Trim the ends off of the pound cake, then slice crosswise into 8 1-inch-thick slices."
      },
      {
        "display_text": "Arrange the pound cake slices tightly in the bottom of the prepared baking dish.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71747,
        "position": 3
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71748,
        "position": 4,
        "display_text": "One at a time, place a strawberry shortcake ice cream bar on top of the pound cake layer, then remove the stick. Freeze for about 3 hours."
      },
      {
        "end_time": 0,
        "temperature": null,
        "id": 71749,
        "position": 5,
        "display_text": "In a medium bowl, toss together the melted butter, freeze-dried strawberries, and shortbread cookies. It should resemble the cookie coating from the outside of the strawberry shortcake bars.",
        "start_time": 0,
        "appliance": null
      },
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71750,
        "position": 6,
        "display_text": "Remove the baking dish from the freezer. Spread the whipped topping over the strawberry shortcake bar layer, then sprinkle generously with the cookie crumble. (Alternatively, to cover the entire cake, lift the plastic wrap to remove the cake from the baking dish and set on a small baking sheet. Cover the top and sides with double the amount of whipped topping and cookie crumble.) Freeze overnight.",
        "start_time": 0
      },
      {
        "display_text": "When ready to serve, use the plastic wrap to remove the ice cream cake from the pan. Place on a cutting board and remove the plastic. Cut into 8–10 pieces and serve immediately.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71751,
        "position": 7
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71752,
        "position": 8,
        "display_text": "Enjoy!"
      }
    ],
