    "instructions": [
      {
        "end_time": 0,
        "temperature": null,
        "id": 71656,
        "position": 1,
        "display_text": "Toast the flour in a medium skillet over low heat, stirring constantly, until light brown in color, about 10 minutes. Remove the pan from the heat and let the flour cool to room temperature, 10 minutes.",
        "start_time": 0,
        "appliance": null
      },
      {
        "id": 71657,
        "position": 2,
        "display_text": "Sift the toasted flour through a fine-mesh strainer into a large bowl to remove any lumps.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null
      },
      {
        "position": 3,
        "display_text": "Pour the cookie crumbs into the bowl with the flour, then add the powdered milk, sugar, and melted butter and mix until the consistency resembles wet sand.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71658
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71659,
        "position": 4,
        "display_text": "To shape the cookies, pack the flour mixture firmly into the polvoron mold, using a spoon to remove any excess around the edges. Turn out onto a baking sheet and repeat with the remaining dough. Refrigerate the cookies for 30 minutes to set, if desired."
      },
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 71660,
        "position": 5,
        "display_text": "Wrap each polvoron individually in a square of cellophane. Store in an airtight container in the refrigerator for up to 1 month. Allow the cookies to come to room temperature before serving.",
        "start_time": 0
      },
      {
        "temperature": null,
        "id": 71661,
        "position": 6,
        "display_text": "Enjoy!",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      }
    ],
